    const p=['保育組','公關組','行政組','社工組','登出']
    return(
    <>
    <div className="head">
        <Title/>
        <Sidebar sidebar_arr={p} style={"lesssmall"} />
        <Sidebar sidebar_arr={p} style={"small"} />
    </div>

    <div className="body"> 
        <Sidebar sidebar_arr={p} style={"large"}/>
        <Article/>
    </div>
    </>
    )
}
export default Admin;
